export let DisplayPokemons = ({pokemons}) => {
    if (pokemons === undefined) return
    return (
        <table >
            {/*<img src={pokemonImage} ></img>*/}
              <tr>
                <td>number</td>
                <td>name</td>
                <td>total</td>
              </tr>
            {pokemons.map(p => {

                return <tr>

                    <td >{p.number}</td>
                    <td >{p.name}</td>
                    <td >{p.total}</td>
                </tr>
            })}
        </table>
    );
}
